description:
An ode to the counterculture of the 80s and 90s, when finding quality culture was a real treasure hunt. 4 minutes long. Will be loved by anyone old enough to have ever collected actual vinyl, or anyone who knows what a zine is. Film is a sort of tone poem to what indie media was like before the Internet. 

Credits: Voice Over by Bucky Sinister. Appearance by Eric Grotke. Photos by Murray Bowles. Music by Alison Faith Levy &amp; Mushroom. Sound Engineer: Chris Xefos. Cinematography by Christian Bruno &amp; Danny Plotnick. Post-production audio fluffing: Michael W. Dean

Awards: Finalist Underground Filmmakers Festival.

